insert into mvc_major_report (unique_id, arrivalDate, arrivalTime, attachedFiles, emsArrivalTime, emsSentTime, formPhotos, intersection_related, intersection_types, linkedId, linkedIdTable, loc_first_harmful_event, mvc_major_diagram, mvc_major_diagram_UID, mvc_major_diagram_direction, mvc_major_diagram_distance, mvc_major_diagram_landmark, mvc_major_diagram_north, mvc_major_dist_dire, mvc_major_dui, mvc_major_fire, mvc_major_hit_run, mvc_major_light, mvc_major_location, mvc_major_location_reference, mvc_major_main_lanes, mvc_major_main_speed, mvc_major_mile_marker, mvc_major_narrative, mvc_major_num_injured, mvc_major_num_killed, mvc_major_num_witness, mvc_major_photo, mvc_major_route, mvc_major_side_lanes, mvc_major_side_speed, mvc_major_special_location, mvc_major_synopsis, mvc_major_total_bc, mvc_major_total_mc, mvc_major_total_mop, mvc_major_total_mv, mvc_major_total_ped, mvc_major_tow, mvc_major_traffic_level, mvc_major_trafficway, mvc_major_weather, mvc_major_workzone, num_first_harmful_event, num_most_harmful_event, report_number, report_type, sentDate, sentTime) values (24646, '2017-12-31', '1058', '567971', '1056', '1054', NULL, '02', '02', 967440, 'reports', '01', 0, 567968, NULL, NULL, NULL, '1', 'Intersection of', '01', '01', '01', '01', '02', 'Harding Avenue and Koko Head Aveue', '2', '25', NULL, '<b><u>ASSIGNMENT/ARRIVAL:</u></b><br>I am currently assigned to the District 7 Patrol, 2nd Watch, as 2M765. On 12-31-17 at approximately 1054 hours, I co responded to a MVC involving a SUV and bicycle at the intersection of Harding Avenue and Koko Head Avenue. I arrived at approximately 1058 hours.<br><br><b><u>SCENE/TIME ELEMENT:</u></b><br>The scene is the intersection of Harding Avenue and Koko Head Avenue. The address_time element is on 12-31-17 approximately 1052 hours.<br><br><b><u>STATEMENT OF UNIT 2 DRIVER:&nbsp; &nbsp;Joy NAKASHIMA (F/53):</u></b><br>NAKASHIMA was interviewed at the intersection of Harding Avenue and KOko head Avenue. She appeared to be sober, coherent, and concerned. NAKASHIMA related that on 12-31-17 about 10:55 am, She was driving with her family in&nbsp; her vehicle, bearing license plate 377-TVN, on Harding Avenue heading West bound approaching the Koko Head Avenue intersection. NAKASHIMA further related that she had the green light and continued through the intersection non stop. Suddenly, an electric bicyclist going North bound on Koko Head Avenue collided with the driverNULLs side front quarter panel area of the vehicle. NAKASHIMA immediately called 911 after stopping. NAKASHIMA and her family members area not injured. Damages to her vehicle is the driverNULLs side front left corner bumper area (scratches and rub marks) and the left front wheel well quarter panel area (dent). Refer to HPD-252.<br><br><b><u>STATEMENT OF UNIT 1 RIDER:</u></b><br>Unable to obtain statement at this address_time due to medical treatment.<br><br><b><u>INJURIES:</u></b><br>Unit 2 vehicle driver and passengers did not have any injuries nor complained of any pain.<br>Per EMT personnel, The bicyclist had possible head injury and possible fractured right shoulder.<br><br><b><u>AMBULANCE:</u></b><br>The ambulance was already on scene prior to my arrival. The bicyclist was transported via ambulance to Queens Medical Hospital in serious but stable condition.<br><br><b><u>DAMAGES:</u></b><br>Damages to Unit 2 vehicle area scratches and rub marks to the left front bumper area and large dent to the left front wheel well quarter panel area.<br>The electric bicycleNULLs handle bars and front wheel appeared to be damaged.<br><br><b><u>HOSPITAL FOLLOW UP REQUEST:</u></b><br>Refer to Officer C. GIBO follow up report.<br><br><b><u>SGT NOTIFIED:</u></b><br>Sgt R. YI was notified of the facts and circumstances.<br><br><b><u>TRAFFIC DIVISION NOTIFIED:</u></b><br>Sgt J. LEFCOURT was notified at approximately 1145 hours.<br><br><b><u>MEDIA ON SCENE:</u></b><br>Hawaii News Now was also arrived on scene.<br><br><b><u>DISPOSITION:</u></b><br>Pending...', 1, 0, 0, '01', NULL, '4', '25', '00', 'Unit 2 MPVH traveling west bound on Harding Ave approaching Koko Head Ave. Unit 2 related they had green light and continued through intersection. Unit 1 bicyclist traveling north bound on Koko Head Ave collides with Unit 2 in intersection. Bicyclist taken to hospital via EMS with possible head injury and possible fracture to right shoulder.', 1, 0, 0, 1, 0, '01', '02', '03', '01', '01', 1, 1, '17495401', 'Initial w/Diagram', '2017-12-31', '1054');
insert into mvc_major_report (unique_id, arrivalDate, arrivalTime, attachedFiles, emsArrivalTime, emsSentTime, formPhotos, intersection_related, intersection_types, linkedId, linkedIdTable, loc_first_harmful_event, mvc_major_diagram, mvc_major_diagram_UID, mvc_major_diagram_direction, mvc_major_diagram_distance, mvc_major_diagram_landmark, mvc_major_diagram_north, mvc_major_dist_dire, mvc_major_dui, mvc_major_fire, mvc_major_hit_run, mvc_major_light, mvc_major_location, mvc_major_location_reference, mvc_major_main_lanes, mvc_major_main_speed, mvc_major_mile_marker, mvc_major_narrative, mvc_major_num_injured, mvc_major_num_killed, mvc_major_num_witness, mvc_major_photo, mvc_major_route, mvc_major_side_lanes, mvc_major_side_speed, mvc_major_special_location, mvc_major_synopsis, mvc_major_total_bc, mvc_major_total_mc, mvc_major_total_mop, mvc_major_total_mv, mvc_major_total_ped, mvc_major_tow, mvc_major_traffic_level, mvc_major_trafficway, mvc_major_weather, mvc_major_workzone, num_first_harmful_event, num_most_harmful_event, report_number, report_type, sentDate, sentTime) values (24649, '2017-12-31', '1105', NULL, NULL, NULL, NULL, NULL, NULL, 967546, 'reports', NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<b><u>FOLLOW-UP</u></b><br><br><br><b><u>A/A</u></b><br>On 12-31-17 I was assigned to D7 uniformed patrol as 2B763. At about 1100 hours I was sent to a MVC case at Harding Avene &amp; Koko Head Avenue. I arrived at about 1105 hours.<br><br><br><b><u>UNIT 1-ELECTRIC BIKE</u></b><br>Bicyclist Ha Pham VO was IDNULLD via Hawaii DriverNULLs Permit.&nbsp; She was being treated in the ambulance by EMS prior to my arrival and when attempting to speak to her, she was conscious but did not respond to my questions.&nbsp; VONULLS bicycle was on the sidewalk area of the intersection and had a serial number K151202250, Brown Kuo A2B Electric Bike.&nbsp; Per dispatch the bicycle had no record and was not registered.&nbsp; On scene, husband Viet Duc TRAN (12-7-86) said that they just bought the E-bike in April 2017 from the E-Bicycle shop in Kapahulu.<br><br><br><b><u>INJURIES/TREATMENT</u></b><br>Per EMS, VO main injury was to the head and shoulder areas.&nbsp; VO was not wearing a helmet when impacted and was ejected from the bicycle.&nbsp; EMS treated VO on scene and took her to Queens hospital in Serious but Stable condition (Per EMS).<br><br><br><b><u>FOLLOW-UP REQUESTED</u></b><br>I requested a follow-up to Queens hospital to get an updated condition on VO and if possible, a verbal or written statement of what happened.&nbsp; D1 Officer J. LEE (2B165) relayed that when speaking to VO, she seemed sedated and told him she did not remember what happened.&nbsp; LEE said she was being treated by Queens ER Dr J. SALATTO and she has injury to her head and upper body/shoulder area but were still treating her and could not inform LEE on the exact extent of her injuries.&nbsp; LEE stated he dropped off an HPD-13 for the doctors info on VONULLS condition.<br><br><br><b><u>ADDITIONAL INFO/NO CITATION</u></b><br>Upon visiting E-Bikes Hawaii at 3318 Campbell Avenue (808-722-5454).&nbsp; Store Manager Mike BERMEA provided me with VONULLS E-Bike info I needed for this report.&nbsp; While on there, BERMEA informed me that E-BIKES are not able to be registered in the State of Hawaii as "Bicycles" because they are not considered bicycles per the current HRS 291C-1. &nbsp;At this address_time I did not cite VO for un-taxed bicycle due to the information provided to me about these new E-Bikes which are electric and human powered.<br><br><br><b><u>DISPOSITION</u></b><br>REFER TO INITIAL ', 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, '17495401', 'Follow Up No Diagram', '2017-12-31', '1100');
