insert into mvc_major_report (unique_id, arrivalDate, arrivalTime, attachedFiles, emsArrivalTime, emsSentTime, formPhotos, intersection_related, intersection_types, linkedId, linkedIdTable, loc_first_harmful_event, mvc_major_diagram, mvc_major_diagram_UID, mvc_major_diagram_direction, mvc_major_diagram_distance, mvc_major_diagram_landmark, mvc_major_diagram_north, mvc_major_dist_dire, mvc_major_dui, mvc_major_fire, mvc_major_hit_run, mvc_major_light, mvc_major_location, mvc_major_location_reference, mvc_major_main_lanes, mvc_major_main_speed, mvc_major_mile_marker, mvc_major_narrative, mvc_major_num_injured, mvc_major_num_killed, mvc_major_num_witness, mvc_major_photo, mvc_major_route, mvc_major_side_lanes, mvc_major_side_speed, mvc_major_special_location, mvc_major_synopsis, mvc_major_total_bc, mvc_major_total_mc, mvc_major_total_mop, mvc_major_total_mv, mvc_major_total_ped, mvc_major_tow, mvc_major_traffic_level, mvc_major_trafficway, mvc_major_weather, mvc_major_workzone, num_first_harmful_event, num_most_harmful_event, report_number, report_type, sentDate, sentTime) values (24658, '2017-12-31', '1621', '568161,568162', NULL, NULL, NULL, NULL, NULL, 968033, 'reports', NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<b><u>FOLLOW-UP</u></b><br><br><br><br><br><b><u>ASSIGNMENT/ARRIVAL:</u></b><br>On 12-31-17, I was assigned to District 4, Uniformed Patrol, as 3M475.&nbsp; At 1615 hours, I co-responded to an MVC report_type case at 54-316 Kamehameha Hwy. and arrived around 1621 hours.&nbsp; <br><br><br><br><br><br><b><u>WITNESS STATEMENT #1:</u></b>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; KOLAKOWSKI, Jackson&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (M/18)<br>On 12-31-17, I spoke to a male who identified himself as Jackson KOLAKOWSKI.&nbsp; J. KOLAKOWSKI appeared to be sober and coherent and related that on 12-31-17 around 1611 hours he was riding in the back left seat of the vehicle sleeping.&nbsp; J. KOLAKOWSKI related that he heard a sound of a loud thud and his dad pulled into the parking lot.&nbsp; J. KOLAKOWSKI related that his dad ran towards a man that fell off the dirt bike and the manNULLs friend picked up the bike, appeared to be upset, and rode it to the side of LongNULLs Drugs and was never seen after.&nbsp; J. KOLAKOWSKI related that the bike was a red dirt bike with a slightly bent front wheel and related that he most likely wonNULLt be able to identify the male who rode off on the bike.&nbsp; J. KOLAKOWSKI related that he was not injured.&nbsp; Refer to HPD252.<br><br><br><br><br><b><u>WITNESS STATEMENT #2:</u></b>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; KOLAKOWSKI, Kyle&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (M/21)<br>On 12-31-17, I spoke to a male who identified himself as Kyle KOLAKOWSKI.&nbsp; K. KOLAKOWSKI appeared to be sober and coherent and related that on 12-31-17 around 1615 hours, he was in the back passenger seat and looked to the right then forward and heard and saw the off road motorbike in a wheelie coming towards us.&nbsp; K. KOLAKOWSKI related that his dad was driving and turned left into the TamuraNULLs market parking lot.&nbsp; K. KOLAKOWSKI related that the male rider went down onto his right side and the motor bike slid into their front fender.&nbsp; K. KOLAKOWSKI related that the motorcyclistNULLs friend got out of a following car and pulled him onto the grass and another friend grabbed a bike, started it, and rode into the lot.&nbsp; K. KOLAKOWSKI related that he was not injured and the guy who took the bike was a local male with short hair, with a black shirt, and a forward flat bill baseball cap.&nbsp; Refer to HPD252.<br><br><br><br><br><b><u>DESCRIPTION OF MALE WHO REMOVED DIRT BICYCLE:</u></b><br>Polynesian male <br>15-20 years old<br>5NULL8"-6NULL2", 180-200 lbs, blk hair, husky&nbsp;build, bro complexion<br>Wearing a blk shirt, red shorts, cap<br><br><br>Refer to HPD458.<br><br><br><b><u>INJURIES:</u></b><br>Both J. KOLAKOWSKI and K. KOLAKOWSKI appeared to have no visible injuries nor complained of any when asked. <br><br><br><b><u>AREA/WITNESS CHECK:</u></b><br>On 12-31-17, I checked the area for any other possible witnesses but the results.&nbsp; I also checked the area for where the witness related the male took the dirt bike but the results were negative.&nbsp; <br><br><br><b><u>VIDEO SURVEILLANCE:</u></b><br>On 12-31-17, I also checked the area for any possible video surveillance cameras but was unable to locate any cameras. <br><br><b><u>DISPOSITION:</u></b><br>Refer to Key Report.', 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, '17495753', 'Follow Up No Diagram', '2017-12-31', '1615');
