as filled out and left with the Queens Medical Nursing Staff. Queens Staff related they will notify HPD when the report has been filled out and completed.<br><br><br>DISPOSITION<br>Pending', 0, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 0, '17495753', 'Follow Up No Diagram', '2017-12-31', '1700');
